script: |
  super -f text -I q8287.spq | sort > q8287.out

inputs:
  - name: q8287.spq
    data: |
      SELECT DISTINCT - COUNT ( * ) FROM tab1 (FORMAT parquet) WHERE + col2 * - 62 + - col0 + - - col2 * + 75 NOT BETWEEN NULL AND - col2 + - + col2;
  - name: tab1

outputs:
  - name: q8287.out
    data: |
      -3
